  epo:hasAdditionalInformation "A Szociális és Gyermekvédelmi Főigazgatóság, mint Ajánlatkérő „Élelmiszersegély biztosítása szociálisan rászoruló megváltozott munkaképességű, valamint rendkívül alacsony jövedelmű időskorú személyek számára az RSZTOP-4.1.1-16-2017-00001 számú projekt keretében” tárgyában közbeszerzési eljárást indított. Az eljárás fajtája keretmegállapodásos, az eljárás első részében közösségi eljárásrend szerinti nyílt eljárás. Ajánlatkérő az Európai Unió Hivatalos Lapjában (TED)-ben eljárást megindító felhívást tett közzé.A keretmegállapodás első része szerinti eljárás megindításának dátuma: 2017.08.02. (eljárást megindító hirdetmény feladása.)Európai Unió Hivatalos Lapjában (TED): 2017/S 147-303975 azonosítószámon 2017.08.03-án jelent meg.Ajánlattevő neve: ENGER Kft.székhelye: 7747 Birján, Józsefmajor 1. 068/1. hrsz.adószám: 11560481-2-02Ajánlat:Számszerűsíthető értékelési szempontokNettó ajánlati összár (HUF) (1 db csomag ajánlati ára) 13 700 HUFAjánlattevő neve: Káta-Mill Plusz Kft.székhelye: 2255 Szentlőrinckáta, 057/101 hrsz.adószám: 26786722-2-13Ajánlat:Számszerűsíthető értékelési szempontokNettó ajánlati összár (HUF) (1 db csomag ajánlati ára) 12 604 HUF"@hu;
