  epo:foreseesContractSpecificTerm <http://data.europa.eu/a4g/resource/ContractTerm/2022-S-220-632521/cbac108a-b047-3e09-a114-28c43d5b8706>;
  epo:hasAdditionalInformation "Ajánlatkérő az ajánlatokat a Kbt. 76 § (2) bekezdés a) pontja alapján a legalacsonyabb árértékelési szempont alapján értékeli a keretmegállapodásos eljárás 1. részében kibocsátott közbeszerzési dokumentumok 2. KÖTET 8. pontjának megfelelően."@hu;
  epo:hasDescription "Különféle élelmiszer segélycsomagok beszerzése az RSZTOP-4.1.1-16-2017-00001 azonosítószámú kiemelt projekt finanszírozásában adásvételi keretmegállapodás keretében, szociálisan rászoruló megváltozott munkaképességű, valamint rendkívül alacsony jövedelmű időskorú személyek számára. Eladó feladata felnőtt élelmiszer egységcsomagok összeállítása a közbeszerzési eljárás dokumentációjában részletezett tartalommal, és várhatóan 1-3 havonkénti leszállítása a dokumentációban megadott helyszínekre. Várható teljesítési időszakok: havonta, azonban Ajánlatkérő felhívja a figyelmet, hogy előfordulhat olyan hónap, amelyben Vevő nem kér teljesítést.A részletezett beszerzendő termékek a közbeszerzési dokumentumok mellékleteként rendelkezésre bocsátott árazatlan terméklistában találhatóak.Megrendelésre kerülő csomag összes mennyisége: 105 000 db. Ezen mennyiség 30% opciót tartalmaz, tehát Ajánlatkérő az összes mennyiség 70%-ára, azaz 73 500 db csomag lehívására vállal kötelezettséget.Keretmegállapodás megkötésére irányuló ajánlati felhívásban rögzítettek alapján várhatóan a mennyiség (amely tájékoztató jellegű, ajánlatkérő fenntartja a változtatás jogát, az előre nem pontosan tervezhető igényekre tekintettel):Minimum 15 000 csomag/hónapMaximum 70 000 csomag/hónapAz egységcsomagokat az eljárásban előírt feliratozással kell ellátni, és egyértelműen szerepelnie kell rajta a „KERESKEDELMI FORGALOMBA NEM HOZHATÓ” szövegnek.A csomag legfeljebb 50 %-os felületén színes képeket kell elhelyezni (amely tartalmaz többek között grafikai elemeket és szöveget), amely képet Ajánlatkérő felhívás mellékleteként bocsát ajánlattevő rendelkezésére. A dobozok két hosszanti oldalán kell a felhívás mellékletében meghatározott grafikákat elhelyezni, az egyik oldalon az egyik, a másik oldalon a másik grafika elhelyezése szükséges.Ajánlattevő csak a keretmegállapodás 1. sz. mellékletében - ajánlattevő neve alatt - felsorolt termékekkel köteles ajánlatot tenni, az ettől eltérő termékeket tartalmazó ajánlat érvénytelen.A megajánlott élelmiszereknek meg kell felelniük a következő jogszabályban foglalt követelményeknek:A szerződés időtartama alatt az Ajánlattevőnek meg kell felelnie a teljesítéskor hatályos vonatkozó jogszabályoknak, különösen: Magyar Élelmiszerkönyv kötelező előírásairól vagy a helyükbe lépő jogszabályok teljesítéskor hatályos rendelkezéseinek.A leszállításra kerülő termékeknek az áruátvétel időpontjában rendelkezniük kell a szavatosságuk minimum 60%-ával.Ajánlatkérő tájékoztató jelleggel a közbeszerzési dokumentáció részeként rendelkezésre bocsájtja a járásokban élő rászorulók számát tartalmazó táblázatot, amely a rászorulók várható számát tartalmazza járásonként igénytől függően, azonban a szám változhat a Magyar Államkincstárnál vezetett rászorulók folyamatosan frissülő adatbázisa alapján. Ajánlatkérő a konkrét megrendelést (lehívást) is frissebb számok alapján készíti el, ezért a mellékelt tábla csak arányokat mutat.Ajánlatkérő kapacitásai függvényében az aktuális adatbázisban szereplő rászorulókat várhatóan 1-3 havonta szükséges ellátni.Továbbiak részletesen a megkötött keretmegállapodás ajánlati felhívásában és közbeszerzési dokumentumaiban."@hu;
